import React, {Fragment} from 'react';
import  LibrarySection  from './library_section';

class Drawer extends React.Component {
    render() {
        return( 
           <Fragment>
                <div>
                    <LibrarySection/>
                </div>
           </Fragment> 
        );
    }
}

export default Drawer;
